function NextVideoList() {
  return (
    <div className="next-video__card">
      <div className="next-video__image-container">
        <img className="next-video__image" src={el.image} alt="" />
      </div>
      <div className="next-video__info">
        <h4 className="next-video__title">{el.title}</h4>
        <p className="next-video__author">{el.channel}</p>
      </div>
    </div>
  );
}

export default NextVideoList;
